import RegisNavbar from './Component/Register/Navbar/RegisNavbar'
import RegisFooter from './Component/Register/Footer/RegisFooter'
import RegisLeftpart from './Component/Register/Leftpart/RegisLeftpart'
import {BrowserRouter as Router,Switch,Route,withRouter} from 'react-router-dom';


function App() {

  const Regis = (props) => {
    const { location } = props;
    if (location.pathname.match(/routeOnWhichToHideIt/)){
      return null;
    }

    return (
      <ComponentToHideContent/>
    )
  }

  return (

    <div> 
  <RegisNavbar />
  <div className="container">
<div className="content">
 <Router >

    <Switch>
    <Route path="/" exact component={Register} /> 
    <Route path="/Login"  component={Login} />
    <Route path="/Register" component={Register} />
    <Route path='/Timeline' component={Timeline} />
    </Switch>

  </Router>
  <RegisLeftpart/>
  </div>
  </div>

  <RegisFooter />
    </div>

  );
}

export default App;
